import React from 'react';
import { Link, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

//components
import Contact from './Contact';

function Navigation() {
    return (
    <div className="flex justify-between items-center bg-red-200 py-4">
        {/* left side */}
        <div className="flex items-center">
            <img src="logo.svg" alt="logo" className="mr-2 h-6"/>
        </div>

        {/* right side */}
        <div className="flex justify-between">
            <a href={<Contact/>} className="inline-block px-4 text-red-600 font-bold hover:text-red-500" >about.</a>
            <a href={<Contact/>} className="inline-block px-4 text-red-600 font-bold hover:text-red-500" >portfolio.</a>
            <a href={<Contact/>} className="inline-block px-4 text-red-600 font-bold hover:text-red-500" >blog.</a>
            <a href={<Contact/>} className="inline-block px-4 bg-red-100 text-red-800 font-hairline rounded" >hire me.</a>
        </div>
    </div>
    )
}

export default Navigation;
